/****************************************************************
  函数名  ：MsgAscii2Bcd
  功  能  ：ASCII码转换为BCD码(内存空间在外部申请)
  输入参数：
  				ascii: 输入ASCII码字符串
  输出参数：
  				bcd:输出BCD码
  				MSG_TRUE :成功
  				MSG_FALSE:失败
  编写者  ：李松峰
  修改记录：创建，2005-10-23
  	奇数总数位数据转换错误，李松峰，2005-11-17
****************************************************************/
static MsgShort MsgBcd2Ascii(char *bcd, char *ascii,  uint8 len)
{
	MsgInt  i = 0, j = 0;

	if (ascii == NULL || bcd == NULL)
	{
		return MSG_FALSE;
	}


	for (i = 0; i < len; i++)
	{

		ascii[j++] = (bcd[i]&0xf0)>>4;
		ascii[j++] = (bcd[i]&0x0f);
	}

	return MSG_TRUE;
}
