//ulLogal==1,为GBK到Unicode转换，ulLogal＝＝0，为Unicode到GBK转换
void GBKAndUnicodeSearch(unsigned char *pcNeedSearch,unsigned char *pcFind,unsigned long ulBeginOffset,
			unsigned long ulEndOffset,unsigned long ulLogal)
{
	unsigned long ul;
	const unsigned char *pcPoint;
	pcPoint=ulLogal?GBKToUnicodeAddress:UnicodeToGBKAddress;
	for(ul=ulBeginOffset;ul<ulEndOffset;ul=ul+4)
	{

		if(ulLogal==1)
		{
			if(pcPoint[ul+1]==*pcNeedSearch&&pcPoint[ul]==*(pcNeedSearch+1))
			{
				pcFind[0]=pcPoint[ul+2];
				pcFind[1]=pcPoint[ul+3];
				return;
			}
		}
		else
		{
			if(pcPoint[ul+2]==*pcNeedSearch&&pcPoint[ul+3]==*(pcNeedSearch+1))
			{
				pcFind[1]=pcPoint[ul];
				pcFind[0]=pcPoint[ul+1];
				return;
			}
		}

	}

}

//＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝
//描述：这个函数用来实现从一个Unicode序的字符串转换成一个GBK序的字符串
//作者：zhao jing
//输入：strGBK――目标字符串，注意：这个字符串是GBK序的，
//		strUnicode――要求转换的Unicode序的字符串。
//		iStrUnicodeLen――Unicode序字符串的长度。
//输出：int――一个整形值，生成字符串的长度。
//维护日志：
//＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝
int Unicode2GBK( unsigned char *strGBK, unsigned char *strUnicode, int iStrUnicodeLen)
{
	int i=0;
	int j=0,k;
	unsigned char qh,wh;
	unsigned char *strGBKtemp;

	//对于Unicode序的字符串来说，肯定是偶数的。
	if( iStrUnicodeLen%2!=0 )
		return 0;

	strGBKtemp = (unsigned char*)SCI_ALLOC(iStrUnicodeLen+1);

	for(i=0; i<iStrUnicodeLen; i=i+2)
	{
		//
		if( strUnicode[i]<0x7f &&strUnicode[i+1]==0)
		{
		 	strGBKtemp[j++]=strUnicode[i];
		}
		//从0x4e00到0x9fa5连续,共20902个码位
		else if(strUnicode[i+1]>=0x4e&&strUnicode[i+1]<=0x9f)
		{

			qh=strUnicode[i+1]-0x4e;
			wh=strUnicode[i];
			if(strUnicode[i+1]==0x9f&&strUnicode[i]>0xa5)
			{
				strGBKtemp[j++]=0;
				strGBKtemp[j++]=0;
			}
			else
			{
				strGBKtemp[j++] = *(UnicodeToGBKAddress+716*4+qh*256*4+wh*4+1);
				strGBKtemp[j++] = *(UnicodeToGBKAddress+716*4+qh*256*4+wh*4);
			}
		}
		//共716个
		else if(strUnicode[i+1]<0x4e)
		{
			strGBKtemp[j]=0;   strGBKtemp[j+1]=0;
			GBKAndUnicodeSearch(strUnicode+i,&strGBKtemp[j],0,716*4,0);
			j=j+2;
		}
		//共173个
		else
		{
			strGBKtemp[j]=0;   strGBKtemp[j+1]=0;
			GBKAndUnicodeSearch(strUnicode+i,&strGBKtemp[j],716*4+20902*4,716*4+20902*4+173*4,0);
			j=j+2;
		}

		if(strGBKtemp[j-2]==0&&strGBKtemp[j-1]==0)
		{
			j-=2;
		}

	}
	strGBKtemp[j]='\0';
	for(k=0;k<j+1;k++)
		strGBK[k]=strGBKtemp[k];
	SCI_FREE(strGBKtemp);

	return j;
}



//＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝
//描述：这个函数用来实现从一个GB序的字符串转换成一个Unicode序的字符串
//作者：赵静
//输入：strGBK――目标字符串，注意：这个字符串因为是Unicode序的，所以在这个
//		字符串的中间可能就有0字符，所以，这个函数同时用返回值返回了一个
//		整型值，代表这个字符串的长度。推荐strUnicode的长度是strGBK长度的2倍。
//		strUnicode――要求转换成Unicode序的GB序的字符串。
//输出：int――一个整形值，生成字符串的长度。
//维护日志：
//＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝
int GBK2Unicode(unsigned char *strUnicode, const unsigned char *strGbk)
{
	int i=0,j=0;
	unsigned char *pcTempBuffer;
	unsigned char qh,wh;
	int iLen=strlen( (char*)strGbk );

	pcTempBuffer=(unsigned char *)SCI_ALLOC(iLen+1);
	strcpy((char*)pcTempBuffer, (char*)strGbk);

	while( i<iLen )
	{
		//如果是Ascii码，则在每一个Ascii码后面加上一个0。
		if( pcTempBuffer[i]<0x7f )
		{
			strUnicode[j++]=pcTempBuffer[i++];
			strUnicode[j++]=0;
		}
		//GBK/3,6080个码位
		else if(pcTempBuffer[i]>=0x81&&pcTempBuffer[i]<=0xa0&&pcTempBuffer[i+1]>=0x40
		       &&pcTempBuffer[i+1]<=0xfe)
		{
			qh=pcTempBuffer[i++]-0x81;
			if(pcTempBuffer[i]<0x7f)
				wh=pcTempBuffer[i++]-0x40;
			else
				wh=pcTempBuffer[i++]-0x41;
			strUnicode[j++]=*(GBKToUnicodeAddress+qh*190*4+wh*4+2);
			strUnicode[j++]=*(GBKToUnicodeAddress+qh*190*4+wh*4+2+1);
		}
		//GBK/4一部分，576个码位
		else if(pcTempBuffer[i]>=0xaa&&pcTempBuffer[i]<=0xaf&&pcTempBuffer[i+1]>=0x40
		       &&pcTempBuffer[i+1]<=0xa0)
		{
			qh=pcTempBuffer[i++]-0xaa;
			if(pcTempBuffer[i]<0x7f)
				wh=pcTempBuffer[i++]-0x40;
			else
				wh=pcTempBuffer[i++]-0x41;
			strUnicode[j++]=*(GBKToUnicodeAddress+qh*96*4+wh*4+2+6080*4+868*4);
			strUnicode[j++]=*(GBKToUnicodeAddress+qh*96*4+wh*4+2+1+6080*4+868*4);
		}
		//GBK/4大部分及GB2312,13680个码位
		else if(pcTempBuffer[i]>=0xb0&&pcTempBuffer[i]<=0xf7&&pcTempBuffer[i+1]>=0x40
		       &&pcTempBuffer[i+1]<=0xfe)
		{
			qh=pcTempBuffer[i++]-0xb0;
			if(pcTempBuffer[i]<0x7f)
				wh=pcTempBuffer[i++]-0x40;
			else
				wh=pcTempBuffer[i++]-0x41;
			strUnicode[j++]=*(GBKToUnicodeAddress+qh*190*4+wh*4+2+6080*4+868*4+576*4);
			strUnicode[j++]=*(GBKToUnicodeAddress+qh*190*4+wh*4+2+1+6080*4+868*4+576*4);
		}
		//GBK/4剩下部分，共592个码位
		else if(pcTempBuffer[i]>=0xf8&&pcTempBuffer[i]<=0xfe&&pcTempBuffer[i+1]>=0x40
		       &&pcTempBuffer[i+1]<=0xa0)
		{
			qh=pcTempBuffer[i++]-0xf8;
			if(pcTempBuffer[i]<0x7f)
				wh=pcTempBuffer[i++]-0x40;
			else
				wh=pcTempBuffer[i++]-0x41;
			if(pcTempBuffer[i-2]==0xfe&&pcTempBuffer[i-1]>0x4f)
			{
				strUnicode[j++]=0;
				strUnicode[j++]=0;
			}
			else
			{
				strUnicode[j++]=*(GBKToUnicodeAddress+qh*96*4+wh*4+2+6080*4+868*4+576*4+13680*4);
				strUnicode[j++]=*(GBKToUnicodeAddress+qh*96*4+wh*4+2+1+6080*4+868*4+576*4+13680*4);
			}
		}
		//GBK/1,GBK/5,为图形符号，不规则，共868个
		else if(pcTempBuffer[i]>=0xa1&&pcTempBuffer[i]<=0xa9&&pcTempBuffer[i+1]>=0x40
		       &&pcTempBuffer[i+1]<=0xfe)
		{
		       strUnicode[j]=0;   strUnicode[j+1]=0;
		       GBKAndUnicodeSearch(pcTempBuffer+i,&strUnicode[j],6080*4,6080*4+868*4,1);
		       i=i+2;  j+=2;
		}
		else
		{
			strUnicode[j++]=0;
			strUnicode[j++]=0;
		}
		if(strUnicode[j-2]==0&&strUnicode[j-1]==0)
		{
			j-=2;
		}
	}

	SCI_FREE(pcTempBuffer);
	return j;
}


/****************************************************************
  函数名：SG_Rcv_Set_Call_Limit
  功  能  ：设置呼叫限制
  输入参数：para:参数
  				len:长度
  输出参数：g_set_info.bCallInDisable  0: 允许呼入 1:限制呼入
  			g_state_info.sAllowAnswer 限制呼入列表

  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
****************************************************************/

static int SG_Rcv_Set_Call_Limit(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	char callin[SG_CALLNUM_SIZE] = {0};
	char callout[SG_CALLNUM_SIZE] = {0};
	MsgInt msgLen;
	int  i;
	uint8 count;
	uint8 count2;
//	char *curr = NULL;

	if (para == NULL || len < 4)
	{
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Set_Call_Limit: PARA");
		return 0;
	}
	SG_Set_Cal_CheckSum();

	//呼入
	if(para[1]&0x01)
	{
		if(para[2] > 10)
			return 0;
		if (para[0] & 0x01)
		{
			//允许呼入
			g_set_info.bCallInDisable = 0;	// 0: 允许呼入
			SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Call_Limit: CALL IN ENABLE");
		}
		else
		{
			//限制呼入
			g_set_info.bCallInDisable = 1; // 1:  限制呼入
			SCI_TRACE_LOW("<<<<<<SG_Rcv_Set_Call_Limit: CALL IN DISABLE");
		}

		SCI_MEMSET(g_state_info.sAllowAnswer,0,SG_CALLNUM_SIZE);

	}

	//呼出

	if(para[1]&0x02)
	{
		if (para[0] & 0x02)
		{
			//允许呼出
			g_set_info.bCallOutDisable = 0;	// 0: 允许呼出
			SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Call_Limit: CALL OUT ENABLE");
		}
		else
		{
			//限制呼出
			g_set_info.bCallOutDisable = 1; // 1:  限制呼出
			SCI_TRACE_LOW("<<<<<<SG_Rcv_Set_Call_Limit: CALL OUT DISABLE");
		}

		SCI_MEMSET(g_state_info.sAllowCall,0,SG_CALLNUM_SIZE);
	}


	// 允许呼入列表
	count = para[2];
	para = para+3;
//	count = *para;

	SCI_TRACE_LOW("<<<<<<There are %d numbers in list,bCallInDisable = %d",count,g_set_info.bCallInDisable);

	if(count > 0 && count < 11 && g_set_info.bCallInDisable == 1)
	{
		int len = 0;
		SCI_MEMSET(g_state_info.sAllowAnswer, 0,sizeof(g_state_info.sAllowAnswer));
		for(i=0;i<count;i++)
		{
			strncpy(g_state_info.sAllowAnswer+len,(char*)para+i*15,15);
			len = strlen(g_state_info.sAllowAnswer);
			strcpy(g_state_info.sAllowAnswer+len," ");
			len += 1;
		}

		SCI_MEMCPY(callin, (char*)(&len), 4);
		SCI_MEMCPY(callin+4, g_state_info.sAllowAnswer, len);

		if(SG_Set_Cfg_Save(CALLIN,(unsigned char*)callin, len+4))
		{
			SCI_TRACE_LOW( "========== sAllowAnswer: ERR");
			return 0;
		}
	}


	//允许呼出列表

	count2 = *(para+count*15);
	if(count2 > 10)
		return 0;
    para = para+1+count*15;

	SCI_TRACE_LOW("<<<<<<There are %d numbers in list,bCallOutDisable = %d",count2,g_set_info.bCallOutDisable);

	if(count2> 0 && count2< 11 && g_set_info.bCallOutDisable == 1)
	{
		int len = 0;
		SCI_MEMSET(g_state_info.sAllowCall, 0,sizeof(g_state_info.sAllowCall));
		for(i=0;i<count2;i++)
		{
			strncpy(g_state_info.sAllowCall+len,(char*)para+i*15,15);
			len = strlen(g_state_info.sAllowCall);
			strcpy(g_state_info.sAllowCall+len," ");
			len += 1;
		}

		SCI_MEMCPY(callout, (char*)(&len), 4);
		SCI_MEMCPY(callout+4, g_state_info.sAllowCall, len);

		if(SG_Set_Cfg_Save(CALLOUT, (unsigned char*)callout, len+4))
		{
			SCI_TRACE_LOW( "========== sAllowAnswer: ERR");
			return 0;
		}
	}


	SG_Set_Save();

	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Call_Limit: DO OK");

	//发送响应报文
	if (MsgSetCallLimit(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}



