/****************************************************************
  函数名：SG_Rcv_Set_Safety
  功  能  ：设置安全中心
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：林兆剑
  修改记录：创建，2009-2-11
****************************************************************/
static int SG_Rcv_Set_Safety(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	unsigned char ack[2] = "";

	int type;
	int flag;
	char psw[7]="";

	if (para == NULL || len <= 2)
	{
		SCI_TRACE_LOW( "SG_Rcv_Set_Service_No: PARA\r\n");
		return 0;
	}

#if (1)
	{
		int i;
		SCI_TRACE_LOW( "========SG_Rcv_Set_Safety======");
		for(i=0; i<len; i++)
		{
			SCI_TRACE_LOW("==0x%02x",para[i]);
		}

	}
#endif /* (0) */

	type = para[0];

	flag = para[1];
	ack[0] = type;

	strncpy(psw, (char *)para+2, 6);

	//检测安全中心密码
	if(memcmp(psw, (char *)g_set_info.sSafetyPsw, 6) == 0)
	{
		SG_Set_Cal_CheckSum();

		switch(type)
		{
			//监控
			case 0x00:
				{
					//开
					if(flag == 0)
					{
						g_set_info.GPSEnable = 0;
					}
					//关
					else if(flag == 1)
					{
						g_set_info.GPSEnable = 1;
					}
				}
				break;
			//防盗
			case 0x01:
				{
					if(flag == 0)
					{
						g_set_info.nTheftState = 1;
					}
					//关
					else if(flag == 1)
					{
						g_set_info.nTheftState = 0;
						if(g_state_info.alarmState & GPS_CAR_STATU_ROB_ALARM)
						{
							g_state_info.alarmState &= ~GPS_CAR_STATU_ROB_ALARM;
							g_set_info.alarmState &= ~GPS_CAR_STATU_ROB_ALARM;
						}
						Pic_Send(0xc5);
					}
				}
				break;
			default:
				break;

		}

		SG_Set_Save();
		GpsDevZB_Send_State();
		ack[1] = 0x00;
	}
	else
	{
		ack[1] = 0x01;
	}

	//发送响应报文
	if (MsgSetSafety(ack, &msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}

