/****************************************************************
 函数名：SG_Rcv_Set_Alarm
 功  能  ：设置报警器
 输入参数：para:参数
					len:长度
 输出参数：无
 返回值：1:正确
				   0:错误
 编写者  ：李松峰
 修改记录：创建，2005-9-20
****************************************************************/
static int SG_Rcv_Set_Alarm(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	int i;

	if (para == NULL || len < 10)
	{
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm: PARA\r\n");
		return 0;
	}

	SCI_TRACE_LOW( "SG_Rcv_Set_Alarm:  Receive");

#if (0)
	for(i = 0; i < 10; i++)
		SCI_TRACE_LOW("%x ",para[i]);
	SCI_TRACE_LOW( "  ");
#endif /* (0) */
	SG_Set_Cal_CheckSum();
	SCI_MEMCPY(&g_set_info.alarmEnable,&para[2], 4);
	SCI_MEMCPY( (char *)&g_set_info.alarmRepeat,&para[6], 4);

	SCI_MEMCPY(&g_set_info.ReserveAlarmEnable,&g_set_info.alarmEnable,sizeof(g_set_info.ReserveAlarmEnable));

	//防盗器
	if (g_set_info.alarmEnable & GPS_CAR_STATU_ROB_ALARM)
	{
		//允许
		g_set_info.bTheftDisable = 0;
		SCI_TRACE_LOW("SG_Rcv_Set_Alarm:  THEFT ENABLE\r\n");
	}
	else
	{
		//禁止
		g_set_info.bTheftDisable = 1;
		SCI_TRACE_LOW("SG_Rcv_Set_Alarm:  THERF DISABLE\r\n");
	}

	//区域
	if (g_set_info.alarmEnable  & (GPS_CAR_STATU_REGION_IN |GPS_CAR_STATU_REGION_OUT))
	{
		//允许
		g_set_info.bRegionEnable = 1;
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm:  REGION ENABLE\r\n");
	}
	else
	{
		//禁止
		g_set_info.bRegionEnable = 0;
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm:  REGION DISABLE\r\n");
	}

	//超速
	if (g_set_info.alarmEnable & GPS_CAR_STATU_SPEED_ALARM)
	{
		//允许
		g_set_info.bOverSpeedEnable = 1;
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm:  OVERSPEED ENABLE\r\n");
	}
	else
	{
		//禁止
		g_set_info.bOverSpeedEnable = 0;
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm: OVERSPEED DISABLE\r\n");
	}

	//路线
	if (g_set_info.alarmEnable & GPS_CAR_STATU_PATH_ALRAM)
	{
		//允许
		g_set_info.bLineEnable = 1;
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm: LINE ENABLE\r\n");
	}
	else
	{
		//禁止
		g_set_info.bLineEnable = 0;
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm: LINE DISABLE\r\n");
	}


	//车窗检测
	if (g_set_info.alarmEnable & GPS_CAR_STATU_DOOR)
	{
		//允许
		SCI_TRACE_LOW( "SG_Rcv_Set_Alarm: DOOR ENABLE\r\n");
	}

	SG_Set_Save();


	SCI_TRACE_LOW( "SG_Rcv_Set_Alarm: DO OK, 0x%x, 0x%x\r\n",g_set_info.alarmEnable,g_set_info.alarmRepeat);

	//发送响应报文
	if (MsgSetAlarm(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}

/****************************************************************
  函数名：SG_Rcv_Set_Init_Gprs
  功  能  ：设置GPRS初始参数
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
  TCP和PROXY改变马上重新连接，李松峰，2005-12-09
****************************************************************/
static int SG_Rcv_Set_Init_Gprs(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	char num, type, paralen;
	int i, p, nIp;
	char /*bApn = 0, bUserPsw = 0,*/ bReconnect = 0;
	char sPort[SG_PORT_LEN + 1] = "", sIp[3+1] = "";
	int  mode = 0;

	if (para == NULL || len <= 1)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Init_Gprs: PARA");
		return 0;
	}

	//参数个数（1）＋（参数类型1（1）＋参数长度（1）＋参数（n））×N
	num = para[0];
	p = 1;

	SG_Set_Cal_CheckSum();
	for (i=0; i<num; i++)
	{
		if (p > len)
			break;

		//参数类型1（1）
		type = para[p];

		p += 1;
		if (p > len)
			break;

		//参数长度（1）
		paralen = para[p];

		p += 1;
		if (p > len)
			break;

		if (p+paralen > len)
			break;

		switch (type)
		{
		//配置中心APN地址
		case MSG_SET_APN:
			if (paralen != SG_APN_LEN)
				break;

			SCI_MEMSET(g_set_info.sAPN, 0, SG_APN_LEN);
			SCI_MEMCPY(g_set_info.sAPN, &para[p], paralen);

			SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Init_Gprs: APN: %s", g_set_info.sAPN);

			break;

		//配置用户名和密码
		case MSG_SET_USER_PSW:
			if (paralen != SG_GPRS_USER_LEN + SG_GPRS_PSW_LEN)
				break;

			SCI_MEMSET(g_set_info.sGprsUser, 0, SG_GPRS_USER_LEN);
			SCI_MEMCPY(g_set_info.sGprsUser, &para[p], SG_GPRS_USER_LEN);

			SCI_MEMSET(g_set_info.sGprsPsw, 0, SG_GPRS_PSW_LEN);
			SCI_MEMCPY(g_set_info.sGprsPsw, &para[p+SG_GPRS_USER_LEN], SG_GPRS_PSW_LEN);

			SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Init_Gprs: USER: %s, PSW: %s", g_set_info.sGprsUser, g_set_info.sGprsPsw);

			break;

		//配置中心TCP地址
		case MSG_SET_TCP:
			if (paralen != SG_IP_LEN + SG_PORT_LEN)
				break;

			SCI_MEMSET(g_set_info.sCenterIp, 0, sizeof(g_set_info.sCenterIp));
			SCI_MEMSET(sIp, 0, sizeof(sIp));

			SCI_MEMCPY(sIp, &para[p], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sCenterIp, "%d", nIp);
			strcat(g_set_info.sCenterIp, ".");

			SCI_MEMCPY(sIp, &para[p+3], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sCenterIp+strlen(g_set_info.sCenterIp), "%d", nIp);
			strcat(g_set_info.sCenterIp, ".");

			SCI_MEMCPY(sIp, &para[p+6], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sCenterIp+strlen(g_set_info.sCenterIp), "%d", nIp);
			strcat(g_set_info.sCenterIp, ".");

			SCI_MEMCPY(sIp, &para[p+9], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sCenterIp+strlen(g_set_info.sCenterIp), "%d", nIp);

			SCI_MEMSET(sPort, 0, sizeof(sPort));
			SCI_MEMCPY(sPort, &para[p+SG_IP_LEN], SG_PORT_LEN);
			g_set_info.nCenterPort = atoi(sPort);

			bReconnect = 1;

			SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Init_Gprs: TCP: %s, PORT: %d", g_set_info.sCenterIp, g_set_info.nCenterPort);

			break;

		//配置中心UDP地址
		case MSG_SET_UDP:
			break;

		//设置VCC号码
		case MSG_SET_VCC:
			break;

		//配置代理地址
		case MSG_SET_PROXY:
			if (paralen != SG_IP_LEN + SG_PORT_LEN)
				break;

			SCI_MEMSET(g_set_info.sProxyIp, 0, sizeof(g_set_info.sProxyIp));
			SCI_MEMSET(sIp, 0, sizeof(sIp));

			SCI_MEMCPY(sIp, &para[p], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sProxyIp, "%d", nIp);
			strcat(g_set_info.sProxyIp, ".");

			SCI_MEMCPY(sIp, &para[p+3], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sProxyIp+strlen(g_set_info.sProxyIp), "%d", nIp);
			strcat(g_set_info.sProxyIp, ".");

			SCI_MEMCPY(sIp, &para[p+6], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sProxyIp+strlen(g_set_info.sProxyIp), "%d", nIp);
			strcat(g_set_info.sProxyIp, ".");

			SCI_MEMCPY(sIp, &para[p+9], 3);
			nIp = atoi(sIp);
			sprintf(g_set_info.sProxyIp+strlen(g_set_info.sProxyIp), "%d", nIp);

			SCI_MEMSET(sPort, 0, sizeof(sPort));
			SCI_MEMCPY(sPort, &para[p+SG_IP_LEN], SG_PORT_LEN);
			g_set_info.nProxyPort = atoi(sPort);

			bReconnect = 1;

			SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Init_Gprs: PROXY IP: %s, PROXY PORT: %d", g_set_info.sProxyIp, g_set_info.nProxyPort);

			break;

		//配置代理使能
		case MSG_SET_PROXY_ENABLE:
			if (paralen != 1)
				break;

			if (g_set_info.bProxyEnable != para[p])
			{
				g_set_info.bProxyEnable = para[p];
				bReconnect = 1;
			}

			SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Init_Gprs: PROXY ENABLE: %d", g_set_info.bProxyEnable);

			break;
		// 设置通讯方式
		case  MSG_SET_COMMUNICATION_TYPE:
		{
			if (paralen != 1)
				break;

			if (g_set_info.nNetType != para[p])
			{
				if (g_set_info.nNetType == MSG_NET_SMS)//短信切换其他模式
				{
					g_set_info.nNetType = para[p];
					mode = SMS_TO_GPRS;

					bReconnect = 1;
				}
				else									//其他模式直接切换或者切换短信模式
				{
					g_set_info.nNetType = para[p];
					if(g_set_info.nNetType == MSG_NET_SMS)	//切换短信模式
					{
						SG_Send_Clear_List(3);
						bReconnect = 1;
					}
				}
			}


			SCI_TRACE_LOW( "<<<<<<THE COMMUNICATION TYPE IS %d",g_set_info.nNetType);

			break;
		}
		default:
			break;
		}

		p += paralen;
	}

	SG_Set_Save();

	//通讯选项改变
	if (bReconnect == 1)
	{
		SG_Net_Disconnect();//断开连接

	}

	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Init_Gprs: DO OK");

	//发送响应报文
	if (MsgSetInitGprs(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}

