/****************************************************************
  函数名：SG_Rcv_Set_Region
  功  能  ：设置区域
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
****************************************************************/
static int SG_Rcv_Set_Region(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	short num;
	int i = 0;
	int Totalnum = 0;

	if (para == NULL || len < 4||len > 2048)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Region: PARA");
		return 0;
	}

	i = 0;
	while(i < len)
	{
		i +=2;
		SCI_MEMCPY(&num, para+i, 2);
		i += 2+num*8;
		Totalnum += num;
	}

	if(i != len)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Region: i:%d,len:%d",i,len);
		return 0;
	}
	if(Totalnum > 150-g_set_info.nLinePiont)
	{
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Set_Region: Too Many Point!!! return!!! rcv point %d left point %d"
			,Totalnum,150-g_set_info.nLinePiont);
		return 0;
	}

	if(g_state_info.pRegion)
		SCI_FREE(g_state_info.pRegion);

	g_state_info.pRegion = SCI_ALLOC(len+4);
	SCI_MEMSET(g_state_info.pRegion,0,len+4);

	if(g_state_info.pRegion == NULL)
	{
		SG_Set_Cal_CheckSum();
		g_set_info.bRegionEnable = 0;
		g_set_info.bnewRegion = 0;
		SG_Set_Save();
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Region: CALLOC: %d", len+4);
		return 0;
	}

	SCI_MEMCPY(g_state_info.pRegion, (char*)(&len), 4);
	SCI_MEMCPY(g_state_info.pRegion+4, para, len);
	SG_Set_Cal_CheckSum();
	g_set_info.bRegionEnable = 1;
	g_set_info.bnewRegion = 0;
	SG_Set_Save();


	Renew_Region_Tab(para,len);


	if(SG_Set_Cfg_Save(REGION,(unsigned char*)g_state_info.pRegion,len+4))
		return 0;


	SCI_TRACE_LOW( "<<<<SG_Rcv_Set_Region:set ok i=%d",i);

	//发送响应报文
	if (MsgSetRegion(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);

		return 1;
	}
	else
		return 0;
}

