/****************************************************************
  函数名：SG_Rcv_Set_Communication_Type
  功  能  ：设置通讯方式
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
  通讯方式SMS改成GPRS时断线重连，李松峰，2005-12-20
****************************************************************/
static int SG_Rcv_Set_Communication_Type(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	char mode = 0;

	if (para == NULL || len < 1)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Communication_Type: PARA");
		return 0;
	}

	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Communication_Type: TYPE: %d", g_set_info.nNetType);

	//发送响应报文
	if (MsgSetCommunicationType(&msg, &msgLen) != MSG_TRUE)
		return 0;


	//发送报文到发送队列
	SG_Send_Put_New_Item(1, msg, msgLen);

	if (g_set_info.nNetType != para[0])
	{
		SG_Set_Cal_CheckSum();
		if (g_set_info.nNetType == MSG_NET_SMS)
		{
			g_set_info.nNetType = para[0];
			mode = SMS_TO_GPRS;
			SG_Net_Disconnect();
		}
		else
		{
			g_set_info.nNetType = para[0];
			if(g_set_info.nNetType == MSG_NET_SMS)
				SG_Send_Clear_List(3);
			mode = GPRS_TO_SMS;
		}


		SG_Set_Save();
	}

	return 1;
}



