/****************************************************************
  函数名：SG_Rcv_Set_Proxy
  功  能  ：配置代理地址
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
  拷贝端口数据长度错误，李松峰，2005-12-12
****************************************************************/
static int SG_Rcv_Set_Proxy(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	int nIp;
	char sPort[SG_PORT_LEN + 1] = "", sIp[3+1] = "";

	if (para == NULL || len != SG_IP_LEN + SG_PORT_LEN)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Proxy: PARA");
		return 0;
	}
	SG_Set_Cal_CheckSum();
	SCI_MEMSET(g_set_info.sProxyIp, 0, sizeof(g_set_info.sProxyIp));
	SCI_MEMSET(sIp, 0, sizeof(sIp));

	SCI_MEMCPY(sIp, &para[0], 3);
	nIp = atoi(sIp);
	sprintf(g_set_info.sProxyIp, "%d", nIp);
	strcat(g_set_info.sProxyIp, ".");

	SCI_MEMCPY(sIp, &para[3], 3);
	nIp = atoi(sIp);
	sprintf(g_set_info.sProxyIp+strlen(g_set_info.sProxyIp), "%d", nIp);
	strcat(g_set_info.sProxyIp, ".");

	SCI_MEMCPY(sIp, &para[6], 3);
	nIp = atoi(sIp);
	sprintf(g_set_info.sProxyIp+strlen(g_set_info.sProxyIp), "%d", nIp);
	strcat(g_set_info.sProxyIp, ".");

	SCI_MEMCPY(sIp, &para[9], 3);
	nIp = atoi(sIp);
	sprintf(g_set_info.sProxyIp+strlen(g_set_info.sProxyIp), "%d", nIp);

	SCI_MEMCPY(sPort, para+SG_IP_LEN, SG_PORT_LEN);
	g_set_info.nProxyPort = atoi(sPort);

	SG_Set_Save();

	SG_Net_Disconnect();

	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Set_Proxy: %s, %d", g_set_info.sProxyIp, g_set_info.nProxyPort);

	//发送响应报文
	if (MsgSetProxy(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}

