static int SG_Rcv_Set_Stop_Tout(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	short  t=0;

	if (para == NULL || len < 2)
	{
		SCI_TRACE_LOW("SG_Rcv_Set_Stop_Tout: PARA\r\n");
		return 0;
	}

	//big-endian
	SCI_MEMCPY((char*)&t, para, 1);
	SCI_MEMCPY((char*)&t+1, para+1, 1);

	SG_Set_Cal_CheckSum();

	g_set_info.nStopTout = t*60;
	if (t != 0)
		g_set_info.bStopToutEnable = 1;
	else
	{
		g_set_info.bStopToutEnable = 0;
		g_state_info.alarmState &= ~GPS_CAR_STATU_STOP_TIMEOUT;
	}

	SG_Set_Save();

	g_state_info.stopTime = 0;
	g_state_info.lastCheckTime = 0;


	SCI_TRACE_LOW("SG_Rcv_Set_Stop_Tout:  %d\r\n", g_set_info.nStopTout);

	//发送响应报文
	if (MsgSetStopTout(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}

