/****************************************************************
  函数名：SG_Rcv_Watch_By_Time
  功  能  ：设置定时监控
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
  压缩汇报保存个数清零，李松峰，2005-12-16
****************************************************************/
static int SG_Rcv_Watch_By_Time(unsigned char *para, int len)
{
	short t = 0;

	if (para == NULL || len < 7)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Watch_By_Time: PARA");
		return 0;
	}
	//监控汇报的报文序列号
	SG_Set_Cal_CheckSum();
	SCI_MEMCPY(g_set_info.sWatchMsgNo, g_state_info.sMsgNo, SG_MSG_NO_LEN);


	//监控时间（2）+ 监控周期（2）+ 拐点补偿(1) + 压缩传送（1）
	g_set_info.nWatchType = MSG_WATCH_TIME;

	SCI_MEMCPY(&t, para, 2);

	g_set_info.nWatchTime = t * 60;
	//清空累积时间从头开始
	g_watch_info.nWatchedTime = 0;
	g_watch_info.nWatchedTime = 0;
	g_watch_info.nLastReportSystemTime = 0;
	SG_Watch_Save();

	SCI_MEMCPY(&t, &para[2], 2);

	g_set_info.nWatchInterval = t;

	g_set_info.nInflexionRedeem = para[4];

	g_set_info.bCompress = (char)para[5];


	g_set_info.bStopReport = para[6];

#if 0
	if(g_set_info.pGps4Compress)
		SCI_FREE(g_set_info.pGps4Compress);
	g_set_info.pGps4Compress = NULL;

	if(g_set_info.bCompress > 0){
		int tlen = 0;
		tlen = (sizeof(gps_data)+4)*g_set_info.bCompress*SG_COMPRESS_NUM;
		g_set_info.pGps4Compress =SCI_ALLOC(tlen+4);

		if(g_set_info.pGps4Compress)
			SCI_MEMCPY(g_set_info.pGps4Compress,(unsigned char*)&tlen,4);
	}
#endif

	//清空GPS保存信息
	SCI_MEMSET(g_state_info.pGpsReport, 0, sizeof(gps_data));
	SCI_MEMSET(g_state_info.pGpsRedeem, 0, sizeof(gps_data));

	SG_Set_Save();

	SCI_TRACE_LOW( "<<<<<<G_Rcv_Watch_By_Time: TIME: %d, INTERVAL: %d, REDEEM: %d, COMPRESS: %d",
		g_set_info.nWatchTime, g_set_info.nWatchInterval, g_set_info.nInflexionRedeem, g_set_info.bCompress);

	//发送响应报文
	//(GPS接收线程检测发送汇报)

	return 1;
}
