/****************************************************************
  函数名：SG_Rcv_Muster_Particular
  功  能  ：调度详细信息
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
****************************************************************/
static int SG_Rcv_Muster_Particular(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	unsigned char gbk[512] = "";
	int gbklen;
	int menuid = MENUID_SINGLE;
	SG_MUSTER_LIST *item = NULL, *tail = NULL, *first = NULL;
	char buf[300] = "";
	int buflen = 0;

	if (para == NULL || len < 0)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Muster_Particular: PARA\r\n");
		return 0;
	}

	//消息内容（N）


	gbklen = Unicode2GBK(gbk, para, len);
	if(!memcmp(&gbk[0],"*#",2))
	{
		SG_Muster_Parse(&gbk[0],gbklen);
		return 0;
	}

	if(g_set_info.bNewUart4Alarm & UT_GPS)
	{
		if(g_set_info.GpsDevType == 2) // YH导航屏
		{
			buflen = gb2312_to_ucs2(gbk,gbklen,buf,300);
			YHGpsDev_Send_Msg(buf, buflen*2,"####",2);
			SCI_TRACE_LOW("len %d gbklen %d buflen %d",len,gbklen,buflen);
		}
	}

//G01B
#ifdef _TRACK
	if((g_set_info.bNewUart4Alarm & UT_TTS)== 0)
	{
		return 1;
	}
#endif

	//创建节点

	item = SCI_ALLOC( sizeof(SG_MUSTER_LIST));
	memset(item,0,sizeof(item));
	if (item == NULL)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Muster_Particular: CALLOC: %d\r\n", sizeof(SG_MUSTER_LIST));
		return 0;
	}

	SCI_MEMCPY(item->msg,gbk,gbklen);
	item->len = gbklen;

	//超过缓冲区最大数目，尾部增加一个开头删除一个
	if (gn_muster_particular_list < MAX_MUSTER_LIST_NUM)
	{
		gn_muster_particular_list+= 1;
	}
	else
	{
		first = gp_muster_particular_list;
		gp_muster_particular_list = gp_muster_particular_list->next;
		SCI_FREE(first);

	}

	tail = gp_muster_particular_list;

	while (tail && tail->next)
	{
		tail = tail->next;
	}

	if (tail)
		tail->next = item;
	else
		gp_muster_particular_list = item;

	item->next = NULL;


	//动态菜单滚动消息框
	SG_DynMenu_Put_AutoShowBox ((unsigned char*)&menuid,(char*) gbk);


	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Muster_Particular: gn_muster_particular_list:%d\r\n",gn_muster_particular_list);

	//发送响应报文
	if (MsgMusterParticular(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}



