/****************************************************************
  函数名：SG_Rcv_Safety_Region_Cancle
  功  能  ：区域报警取消
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
****************************************************************/
static int SG_Rcv_Safety_Region_Cancle(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	int RegionLen = -1;
	int j = 0;

	if(para ==NULL || len < 0)
	{
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Region_Cancle: PARA ERR");
		goto report;
	}

	if(g_state_info.pRegion)
		SCI_MEMCPY((char*)(&RegionLen),g_state_info.pRegion,4);

	if(RegionLen < 0)
	{
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Region_Cancle: REGION LEN ERR OR REGION iS NULL");
		goto report;
	}
	{
		int i = 0;
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Region_Cancle: len %d",len);
		for(i=0;i<len;i++)
			SCI_TRACE_LOW("<%02x>",para[i]);

	}

	if (g_state_info.pRegion)
	{

		if(len == 0)
		{
			SCI_FREE(g_state_info.pRegion);
			g_state_info.pRegion = NULL;
		}

		while(--len >= 0 && g_state_info.pRegion)
		{
			SCI_MEMCPY((char*)(&RegionLen),g_state_info.pRegion,4);
			RegionLen +=4;
			j = 4;
			while(j < RegionLen)
			{
				short num;
				SCI_MEMCPY((char*)&num, g_state_info.pRegion+j+2, 2);

				SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Region_Cancle: num %d",num);
				SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Region_Cancle: param[%d] %d region[%d] %d",len,para[len],j,g_state_info.pRegion[j]);
				if(para[len] == g_state_info.pRegion[j])
				{
					if(g_set_info.bnewRegion)
					{
						SCI_MEMCPY(g_state_info.pRegion+j,g_state_info.pRegion+j+num*8+32,RegionLen-j-num*8-32);
						RegionLen -= num*8+32;
						RegionLen -=4;

					}
					else
					{
						SCI_MEMCPY(g_state_info.pRegion+j,g_state_info.pRegion+j+num*8+4,RegionLen-j-num*8-4);
						RegionLen -= num*8+4;
						RegionLen -=4;
					}

					if(RegionLen > 0)
					{
						SCI_MEMCPY(g_state_info.pRegion,(char*)(&RegionLen),4);
					}
					else
					{
						SCI_FREE(g_state_info.pRegion);
						g_state_info.pRegion = NULL;
					}
					break;
				}
				if(g_set_info.bnewRegion)
					j+=32+num*8;
				else
					j+= 4+num*8;
			}
		}

		if(g_state_info.pRegion && RegionLen > 0)
		{
			SCI_MEMCPY((char*)(&RegionLen),g_state_info.pRegion,4);
		}
		else
		{
			RegionLen = -1;
		}

		if(RegionLen <= 0)
		{
			if(g_state_info.pRegion)
				SCI_FREE(g_state_info.pRegion);
			g_state_info.pRegion = NULL;

		}
		else
		{
			g_state_info.pRegion = (char*)realloc(g_state_info.pRegion,RegionLen+4);

		}
	}
	else
	{
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Region_Cancle: REGION ERR");
	}

	if(g_state_info.pRegion && RegionLen > 0)
		Renew_Region_Tab((unsigned char*)g_state_info.pRegion+4, RegionLen);
	else
		Renew_Region_Tab(NULL,-1);

	SG_Set_Save();

	if(g_state_info.pRegion)
	{
		if(SG_Set_Cfg_Save(REGION,(unsigned char*)g_state_info.pRegion,RegionLen+4))
		{
			SCI_TRACE_LOW( "--SG_Rcv_Safety_Region_Cancle: ERR");
			return 0;
		}
	}
	else
		EFS_Delete(REGION_FILE_PATH);

	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Safety_Region_Cancle: DO OK");

report:
	//发送响应报文
	if (MsgSafetyRegionCancle(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);

		return 1;
	}
	else
		return 0;
}

/****************************************************************
  函数名：SG_Rcv_Safety_Line_Cancle
  功  能  ：路线报警取消
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
****************************************************************/
static int SG_Rcv_Safety_Line_Cancle(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	int line_len = 0;
	int j = 0;

	if(para ==NULL || len < 0){
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Line_Cancle: PARA ERR");
		goto report;
	}

	if(g_state_info.pLine)
		SCI_MEMCPY((char*)(&line_len),g_state_info.pLine,4);

	if(line_len < 0){
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Line_Cancle: REGION LEN ERR OR REGION iS NULL");
		goto report;
	}
	SG_Set_Cal_CheckSum();

	if (g_state_info.pLine){

		if(len == 0){
			SCI_FREE(g_state_info.pLine);
			g_state_info.pLine = NULL;
			g_set_info.bLineEnable = 0;
			g_set_info.bnewSpeedLine = 0;
		}

		while(--len >= 0 && g_state_info.pLine)
		{
			SCI_MEMCPY((char*)(&line_len),g_state_info.pLine,4);

			line_len += 4;
			j = 4;
			while(j < line_len)
			{
				short num;
				SCI_MEMCPY((char*)&num, g_state_info.pLine+j+1, 2);
	//			SCI_MEMCPY((char*)&num, g_state_info.pLine +j+1+1, 1);
				SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Line_Cancle: num %d",num);
				SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Line_Cancle: param[%d] %d line[%d] %d",len,para[len],j,g_state_info.pLine[j]);
				if(para[len] == g_state_info.pLine[j]){
					if(g_set_info.bnewSpeedLine == 1){
						SCI_MEMCPY(g_state_info.pLine+j,g_state_info.pLine+j+num*8+5,line_len-j-num*8-5);
						line_len -= num*8+5;
					}
					else{
						SCI_MEMCPY(g_state_info.pLine+j,g_state_info.pLine+j+num*8+3,line_len-j-num*8-3);
						line_len -= num*8+3;
					}

					if(line_len > 4){
						line_len -= 4;
						SCI_MEMCPY(g_state_info.pLine ,(char*)(&line_len),4);
						line_len +=4;
					}
					else{
						SCI_FREE(g_state_info.pLine);
						g_state_info.pLine = NULL;
						break;
					}
					break;
				}
				if(g_set_info.bnewSpeedLine == 1)
					j+=5+num*8;
				else
					j+=3+num*8;
			}
		}

		if(g_state_info.pLine && line_len> 4)
		{
			SCI_MEMCPY((char*)(&line_len),g_state_info.pLine,4);
		}
		else
		{
			line_len = -1;
		}

		if(line_len <= 0)
		{
			if(g_state_info.pLine)
				SCI_FREE(g_state_info.pLine);
			g_state_info.pLine= NULL;
			g_set_info.bLineEnable = 0;
			g_set_info.bnewSpeedLine = 0;

		}
		else{
			g_state_info.pLine = (char*)realloc(g_state_info.pLine,line_len+4);
		}
	}
	else{
		SCI_TRACE_LOW("<<<<<<SG_Rcv_Safety_Line_Cancle: REGION ERR");
		g_set_info.bLineEnable = 0;
		g_set_info.bnewSpeedLine = 0;
	}

	if(g_state_info.pLine && line_len > 0)
		renew_line_tab((unsigned char*)g_state_info.pLine+4, line_len);
	else{
		renew_line_tab(NULL, -1);
	}

	SG_Set_Save();
	if(g_state_info.pLine){
		if(SG_Set_Cfg_Save(LINE,(unsigned char*)g_state_info.pLine,line_len+4)){
			SCI_TRACE_LOW( "@_@   SG_Rcv_Set_Line: ERR");
			return 0;
		}
	}
	else
		EFS_Delete(SG_SET_LINE_FILE);


	{
		int j;
		if(line_len < 0){
			SCI_TRACE_LOW("<<<<<<SG_Rcv_Set_Line:enbale %d ,len %d",g_set_info.bLineEnable,line_len);
		}
		else{
			SCI_TRACE_LOW("<<<<<<SG_Rcv_Set_Line:enbale %d ,len %d",g_set_info.bLineEnable,line_len);
			for(j =0;j<line_len;j++){
				SCI_TRACE_LOW("<%02x> ",g_state_info.pLine[j]);
			}

		}
	}

	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Safety_Line_Cancle: DO OK");

report:
	if(g_state_info.alarmState & GPS_CAR_STATU_PATH_ALRAM)
		g_state_info.alarmState &= ~GPS_CAR_STATU_PATH_ALRAM;
	//发送响应报文
	if (MsgSafetyLineCancle(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}

