/***************************************************************
插入油量参考点
(从小到大进行排列)
***************************************************************/
void insert_tab_consult(SG_INFO_OIL *item)
{
	SG_INFO_OIL*p1=NULL,*p0=NULL,*p2=NULL;

	p1=gp_oil_list;
	p0=item;

	if(gp_oil_list==NULL)
	{
		gp_oil_list=p0;
		p0->next=NULL;
	}
	else
	{
		while((p0->nconsult>p1->nconsult)&&(p1->next!=NULL))
		{
			p2=p1;
			p1=p1->next;
		}
		if(p0->nconsult<=p1->nconsult)
		{
			if(gp_oil_list==p1)
				gp_oil_list=p0;
			else
				p2->next=p0;
			p0->next=p1;
		}
		else
		{
			p1->next=p0;
			p0->next=NULL;
		}
	}

}

/****************************************************************
更新参考点列表
*****************************************************************/
int   renew_consult_tab(unsigned char *para,int len)
{
	SG_INFO_OIL *p0=NULL,*item=NULL;
	int j=14,ncount=0;


	if(gp_oil_list)
	{
		while(gp_oil_list)
		{
			p0=gp_oil_list->next;
			SCI_FREE(gp_oil_list);
			gp_oil_list=p0;;
		}
		gp_oil_list=NULL;
	}
	ncount=para[13]; //参考点个数
	while(ncount-->0)
	{

		item=(SG_INFO_OIL *)SCI_ALLOC(sizeof(SG_INFO_OIL));
		item->nPersernt=para[j];
		SCI_MEMCPY((char *)&item->nconsult,para+j+1,1);
		SCI_MEMCPY((char *)&item->nconsult+1,para+j+2,1);
		SCI_MEMCPY((char *)&item->nconsult+2,para+j+3,1);
		SCI_MEMCPY((char *)&item->nconsult+3,para+j+4,1);
		SCI_TRACE_LOW( "ncount: %d    item->nconsult: %d\r\n", ncount,item->nconsult);
		insert_tab_consult(item);
		j+=5;

	}
	return 1;
}

/****************************************************************
  函数名：SG_Rcv_Set_Alarm_AD
  功  能  ：配置油量参考点
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
****************************************************************/
static int SG_Rcv_Set_Oil_Consult(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;
	int t=0;
	int i=0;
	int  NoRunAD1=0,NoRunAD2=0;
	int  RunAD1=0,RunAD2=0;
	int  ADCount=0,VIndex=0;


	if (para == NULL || len <4)
	{
		SCI_TRACE_LOW("SG_Rcv_Set_Oil_Consult: PARA\r\n");
		return 0;
	}

	SG_Set_Cal_CheckSum();

	VIndex=para[0];
//发动时 加油前AD值
	SCI_MEMCPY((char *)&RunAD1,para+1,1);
	SCI_MEMCPY((char *)&RunAD1+1,para+2,1);
	SCI_MEMCPY((char *)&RunAD1+2,para+3,1);
	SCI_MEMCPY((char *)&RunAD1+3,para+4,1);
	//g_set_info.MaxAD=RunAD1;
	SCI_TRACE_LOW("SG_Rcv_Set_Oil_Consult:RunAD1:%d\r\n",RunAD1);
//发动时加满油后AD 值
	SCI_MEMCPY((char *)&RunAD2,para+5,1);
	SCI_MEMCPY((char *)&RunAD2+1,para+6,1);
	SCI_MEMCPY((char *)&RunAD2+2,para+7,1);
	SCI_MEMCPY((char *)&RunAD2+3,para+8,1);
	SCI_TRACE_LOW("SG_Rcv_Set_Oil_Consult:RunAD2:%d\r\n",RunAD2);
//未发动时加油前AD值
	SCI_MEMCPY((char *)&NoRunAD1,para+15,1);
	SCI_MEMCPY((char *)&NoRunAD1+1,para+16,1);
	SCI_MEMCPY((char *)&NoRunAD1+2,para+17,1);
	SCI_MEMCPY((char *)&NoRunAD1+3,para+18,1);
	SCI_TRACE_LOW("SG_Rcv_Set_Oil_Consult:NoRunAD1:%d\r\n",NoRunAD1);
//未发动时加油后AD值
	ADCount=para[13];
	ADCount=15+5*(ADCount-1);
	SCI_MEMCPY((char *)&NoRunAD2,para+ADCount,1);
	SCI_MEMCPY((char *)&NoRunAD2+1,para+ADCount+1,1);
	SCI_MEMCPY((char *)&NoRunAD2+2,para+ADCount+2,1);
	SCI_MEMCPY((char *)&NoRunAD2+3,para+ADCount+3,1);
    //g_set_info.MinAD=NoRunAD2;
	SCI_TRACE_LOW("SG_Rcv_Set_Oil_Consult:NoRunAD2:%d\r\n",NoRunAD2);
//油箱类型
	if(RunAD1 > RunAD2)
	{
		g_set_info.OilFlag = 0;
		g_set_info.MaxAD = RunAD1;
		g_set_info.MinAD = NoRunAD2;
	}
	else
	{
		g_set_info.OilFlag = 1;
		g_set_info.MaxAD = RunAD2;
		g_set_info.MinAD = NoRunAD1;
	}

//计算K值(平均值)
	g_set_info.K_AD=50*((float)RunAD1/NoRunAD1+(float)RunAD2/NoRunAD2-2);
	SCI_TRACE_LOW("SG_Rcv_Set_Oil_Consult:K_AD:%d\r\n",g_set_info.K_AD);
//油量总容积
	SCI_MEMCPY((char *)&t,para+9,1);
	SCI_MEMCPY((char *)&t+1,para+10,1);
	SCI_MEMCPY((char *)&t+2,para+11,1);
	SCI_MEMCPY((char *)&t+3,para+12,1);
	g_set_info.nTotalVolume=t;
	SCI_TRACE_LOW("SG_Rcv_Set_Oil_Consult:nTotalVolume:%d\r\n",g_set_info.nTotalVolume);

	if(g_state_info.pConsult)
		SCI_FREE(g_state_info.pConsult);
	g_state_info.pConsult = SCI_ALLOC(len+4);
	if(g_state_info.pConsult == NULL){
		SCI_TRACE_LOW( "SG_Rcv_Set_Oil_Consult: CALLOC: %d\r\n", len+4);
		return 0;
	}
	SCI_MEMSET(g_state_info.pConsult,0, len+4);
	SCI_MEMCPY(g_state_info.pConsult, (char*)(&len), 4);
	SCI_MEMCPY(g_state_info.pConsult+4, para, len);


	SG_Set_Save();
	if(SG_Set_Cfg_Save(CONSULT,(unsigned char*)g_state_info.pConsult,len+4))
	{
		SCI_TRACE_LOW( "@_@   SG_Rcv_Set_Oil_Consult: ERR");
		return 0;
	}
	if(1)
	{
		SCI_TRACE_LOW("SG_Rcv_Set_Region:len %d\r\n",len);
		for(i=0;i<len;i++){
			SCI_TRACE_LOW("%02x",g_state_info.pConsult[i+4]);
		}
	}

	//发送响应报文

	if (MsgSetConsult(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		renew_consult_tab(para,len);
		return 1;
	}
	else
		return 0;
}





/****************************************************************
  函数名：SG_Rcv_Safety_Overspeed_Cancle
  功  能  ：超速报警取消
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：李松峰
  修改记录：创建，2005-9-20
****************************************************************/
static int SG_SAFETY_CHG_PASSWD(unsigned char *para, int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen;

	if(para == NULL || len <= 0 || len > PSW_SHA1_LEN)
		return 0;

	if(len >= 8)
		len = strlen((char*)para);

	if(len > 8)
		len = 8;

	SCI_TRACE_LOW("<<<<<<<<SG_SAFETY_CHG_PASSWD %s",para);
	SCI_TRACE_LOW("<<<<<<<<SG_SAFETY_CHG_PASSWD %d %02x %02x %02x %02x %02x %02x %02x %02x "
		,len,para[0],para[1],para[2],para[3],para[4],para[5],para[6],para[7]);


	SG_Set_Cal_CheckSum();

	SCI_MEMSET(g_set_info.sSuperPsw,0,sizeof(g_set_info.sSuperPsw));
	memcpy(g_set_info.sSuperPsw,para,len);

	SG_Set_Save();

	SCI_TRACE_LOW("<<<<<<SG_SAFETY_CHG_PASSWD: DO OK\r\n");

	//发送响应报文
	if (MsgSafetyChgPasswd(&msg, &msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}



/****************************************************************
  函数名：SG_Rcv_Self_define_Alarm
  功  能  ：自定义报警
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：陈海华
  修改记录：创建，2006-9-8
****************************************************************/
static int SG_Rcv_Self_Define_Alarm(unsigned char *para,int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen = 0;
	unsigned long alarm = 0;

	if (para == NULL || len < 10)
	{
		SCI_TRACE_LOW( "<<<<<<SG_Rcv_Self_Define_Alarm: PARA");
		return 0;
	}

	SG_Set_Cal_CheckSum();
	g_set_info.alarmEnable &= ~0x3F000000;
	SCI_MEMCPY( &alarm,&para[0], 4);
	g_set_info.alarmEnable |= alarm;

	g_set_info.alarmRepeat  &= ~0x3F000000;
	SCI_MEMCPY( &alarm,&para[4], 4);
	g_set_info.alarmRepeat = alarm;

	g_set_info.alarmSet = 0;
	SCI_MEMCPY( &alarm,&para[8], 4);
	g_set_info.alarmSet = alarm&0x3f000000;

	if(len > 12)
	{
		g_set_info.nIoAlarmMask = 0;
		SCI_MEMCPY(&alarm,&para[12],4);
		g_set_info.nIoAlarmMask = alarm;
	}

	SG_Set_Save();

	SCI_TRACE_LOW( "<<<<<<SG_Rcv_Self_Define_Alarm:0x%08x, 0x%08x,0x%08x",g_set_info.alarmEnable,g_set_info.alarmRepeat,g_set_info.alarmSet );

	//发送响应报文
	if (MsgSelfDefineAlarmAck(&msg,&msgLen) == MSG_TRUE)
	{
		//发送报文到发送队列
		SG_Send_Put_New_Item(1, msg, msgLen);
		return 1;
	}
	else
		return 0;
}


/****************************************************************
  函数名：SG_Rcv_Ext_Dev_Set
  功  能  ：中心发送设置外部设备命令
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：陈海华
  修改记录：创建，2006-7-4
  			      	修改，添加电子铅封发送功能，2006-9-20， 陈利
****************************************************************/
static int SG_Rcv_Ext_Dev_Set(unsigned char *para,int len)
{
	MsgUChar *msg = NULL;
	MsgInt msgLen = 0;
	short devID = 0;

	msg = SCI_ALLOC( len + 1);
	SCI_MEMSET(msg,0,len + 1);
	if (msg == NULL)
	{
		SCI_TRACE_LOW("SG_Rcv_Ext_Dev_Set: CALLOC: %d\r\n", len + 1);
		return 0;
	}
	//命令格式:外设标识（2）+命令数据（n）
	//memcpy(&devID, para,1);
	//memcpy(&devID+1, para+1,1);

	devID = para[0];
	devID = (devID<<8) + para[1];

//	devID = ntohl(devID);
	msgLen = len - 2;
	memcpy(msg,para+2,msgLen);

	SCI_TRACE_LOW("SG_Rcv_Ext_Dev_Set:0x%04x  %d\n",devID,msgLen);
	if(msgLen>0)
	{
		if(devID==0x01 && (g_set_info.bNewUart4Alarm&UT_BUS))
		{
			SG_Bus_Dev_Snd_Msg((unsigned char)devID,0x81,msg,msgLen);

		}
		else if(g_set_info.bNewUart4Alarm&(UT_HBLED|UT_LED))
		{
			SIO_WriteFrame(COM_DEBUG,msg,msgLen);
		}
		else if((g_set_info.bNewUart4Alarm&(UT_LED2|UT_LED))==UT_LED2)
		{
			SIO_WriteFrame(COM2,msg,msgLen);
		}
		else if(g_set_info.bNewUart4Alarm & UT_WATCH)
		{
			SIO_WriteFrame(COM_DEBUG, msg, msgLen);
		}
	}
	SCI_TRACE_LOW("SG_Rcv_Ext_Dev_Set:OK\r\n");
	free(msg);
	return 1;

}


