/****************************************************************
  函数名：SG_Rcv_Camera_Set_Ask
  功  能  ：(   中心)捕获图像帧
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：陈海华
  修改记录：创建，2006-3-7
	  接收中心来的消息01；启动摄像头；
	  增加摄像头流水号，2006-7-27，陈海华
	  增加摄像头存储本地，2007-3-21 ，陈海华
****************************************************************/
static int SG_Rcv_Camera_Set_Ask(unsigned char *para,int len)
{
	unsigned long nCameraAlarm=0;
	unsigned long nPicSave=0;
	unsigned short temp =0;
	uint32 sig_size;
	char sig[3];
	xSignalHeaderRec      *signal_ptr = NULL;

	//格式:捕获方式（1）＋摄像头ID (1) +监控标志位（4）+条件监控上传标志位（4）
	//+ 次数（2）+ 间隔（2）+ 图像质量（1）+ 图像亮度（1）+ 对比度 (1) + 饱和度 (1) + 色度 (1)
	if (para == NULL || len == 0)
	{
		SCI_TRACE_LOW( "<<SG_Rcv_Camera_Set_Ask: PARA\r\n");
		return 0;
	}

	//监控标志位
	memcpy(&nCameraAlarm,para+2,4);

	//条件监控上传标志位
	SG_Set_Cal_CheckSum();
	memcpy(&nPicSave,para+6,4);
//	nPicSave = htonl(nPicSave);
	SCI_TRACE_LOW("<<<<<<<<nCameraAlarm %x picsave %x",nCameraAlarm,nPicSave);


	memcpy(g_set_info.sCameraMsgNo, g_state_info.sMsgNo, SG_MSG_NO_LEN);

	// 实时
	if(nCameraAlarm & 0x01)
	{
		CAMERA  cur_camera;
		int  oldtime;

		memcpy(&cur_camera,&g_set_info.sg_camera[0],sizeof(CAMERA));
//		g_set_info.bPictureSave=0;
		g_set_info.sg_camera[0].bSetted = 0;
		g_set_info.sg_camera[0].bCaptureWay = para[0] ;//捕获方式
		g_set_info.sg_camera[0].nCameraID = para[1] ;//摄像头ID (1)
		memcpy(&g_set_info.sg_camera[0].nCount ,para+10,2);//次数（2）
		g_set_info.sg_camera[0].setCount = g_set_info.sg_camera[0].nCount ;
		memcpy(&temp,para+12,2);//间隔（2）
		g_set_info.sg_camera[0].nInterval = temp/10;
		g_set_info.sg_camera[0].nImageQuality =para[14] ;// 图像质量（1）
		g_set_info.sg_camera[0].nImageBright =para[15] ;// 图像亮度（1）
		g_set_info.sg_camera[0].nContrast =para[16] ;// 对比度 (1)
		g_set_info.sg_camera[0].nSaturation =para[17] ;// 饱和度 (1)
		g_set_info.sg_camera[0].nChroma =para[18] ;// 色度 (1)
		g_set_info.nCameraAlarm = (g_set_info.nCameraAlarm & ~0x01) | nCameraAlarm;

		if(g_set_info.sg_camera[0].nCount == 1)
		{

			SCI_TRACE_LOW( "<<SG_Rcv_Camera_Set_Ask: DIRECT 1! interv = %d , setcount = %d count = %x ImageQuality = %d temp = %d\r\n ",g_set_info.sg_camera[0].nInterval,g_set_info.sg_camera[0].setCount,g_set_info.sg_camera[0].nCount,g_set_info.sg_camera[0].nImageQuality,temp);
			//Resume to old Params
			sig[0] = g_set_info.sg_camera[0].nImageQuality;
			sig[1] = CAMERA_ONE_REQ;
			sig[2] = PIC_NOT_SAVE;
			SG_CreateSignal_Para(SG_CAMERA_ONE_ASK,3, &signal_ptr,sig); // 发送信号到主循环要求处理发送队列中的报文

			memcpy(&g_set_info.sg_camera[0],&cur_camera,sizeof(CAMERA));
			SG_Set_Save();

			return 1;
		}
		CameraWatchTimer = GetTimeOut(0); // 重置监控时间，一设置下去，立刻上拍图片
		SCI_TRACE_LOW( "<<SG_Rcv_Camera_Set_Ask: DIRECT   interv = %d , setcount = %d  count = %d camId = %x \r\n"
			,g_set_info.sg_camera[0].nInterval,g_set_info.sg_camera[0].setCount,g_set_info.sg_camera[0].nCount,g_set_info.sg_camera[0].nCameraID);
	}
	else // 条件
	{
		//#ifdef _DUART // 双串口版本才开启保存图片功能
		g_set_info.bPictureSave = nPicSave;
		//#endif
		g_set_info.sg_camera[1].bSetted = 0;
		g_set_info.sg_camera[1].bCaptureWay = para[0] ;//捕获方式
		g_set_info.sg_camera[1].nCameraID = para[1] ;//摄像头ID (1)
		memcpy(&g_set_info.sg_camera[1].nCount ,para+10,2);//次数（2）
		g_set_info.sg_camera[1].setCount = g_set_info.sg_camera[1].nCount ;
		g_set_info.sg_camera[1].nCount = 0;
		memcpy(&temp,para+12,2);//间隔（2）
		g_set_info.sg_camera[1].nInterval = temp/10;
		g_set_info.sg_camera[1].nImageQuality =para[14] ;// 图像质量（1）
		g_set_info.sg_camera[1].nImageBright =para[15] ;// 图像亮度（1）
		g_set_info.sg_camera[1].nContrast =para[16] ;// 对比度 (1)
		g_set_info.sg_camera[1].nSaturation =para[17] ;// 饱和度 (1)
		g_set_info.sg_camera[1].nChroma =para[18] ;// 色度 (1)
		g_set_info.nCameraAlarm = (g_set_info.nCameraAlarm & 0x01) | nCameraAlarm;
		SCI_TRACE_LOW( "<<SG_Rcv_Camera_Set_Ask: CONDITION %08x  intev = %d , setcount = %d count = %d camId = %x temp = %d\r\n"
			,g_set_info.nCameraAlarm,g_set_info.sg_camera[1].nInterval,g_set_info.sg_camera[1].setCount,g_set_info.sg_camera[1].nCount,g_set_info.sg_camera[1].nCameraID,temp);
	}

	//摄像头流水号

	SG_Set_Save();
	SCI_TRACE_LOW( "<<SG_Rcv_Camera_Set_Ask OK\r\n");
	return 1;

}


/****************************************************************
  函数名：SG_Rcv_Camera_Stop_Ask
  功  能  ：请求停止或者重新传输
  输入参数：para:参数
  				len:长度
  输出参数：无
  返回值：1:正确
  			   0:错误
  编写者  ：陈海华
  修改记录：创建，2006-3-7
	添加多路停止监控,不清除监控标致位,陈海华,2006-6-6
  	增加流水号，2006-7-27，陈海华
****************************************************************/
static int SG_Rcv_Camera_Stop_Ask(unsigned char *para,int len)
{
	int  alarmEnable;
	unsigned char stopCameraID = 0;
	xSignalHeaderRec      *signal_ptr = NULL;

	SG_Set_Cal_CheckSum();
	//摄像头流水号
	memcpy(g_set_info.sCameraMsgNo, g_state_info.sMsgNo, SG_MSG_NO_LEN);

	//清空消息队列内容
	SG_Send_Clear_List(2);

	stopCameraID = para[0];

	memcpy((char *)&alarmEnable, para+1,4);

	SCI_TRACE_LOW( "<<SG_Rcv_Camera_Stop_Ask: camerId %x ,alarmenable %x\r\n",stopCameraID,alarmEnable);


	//停止实时监控x 路摄像头
	if(alarmEnable&0x01)
	{
		g_set_info.sg_camera[0].nCameraID &= ~stopCameraID;
		SCI_TRACE_LOW( "<<SG_Rcv_Camera_Stop_Ask: RealTime camerId: %02x\r\n",g_set_info.sg_camera[0].nCameraID);
	}
	//停止条件监控x路摄像头
	if(alarmEnable&(~0x01))
	{
		g_set_info.sg_camera[1].nCameraID &= ~stopCameraID;
		SCI_TRACE_LOW( "<<SG_Rcv_Camera_Stop_Ask: Condition camerId: %02x\r\n",g_set_info.sg_camera[1].nCameraID);
	}

	//清除实时标志位
	if(g_set_info.sg_camera[0].nCameraID == 0)
	{
		g_set_info.nCameraAlarm &= ~0x01;
		SCI_TRACE_LOW( "<<SG_Rcv_Camera_Stop_Ask: RealTime clear alarm.\r\n");
	}

	//清除条件标志位
	if(g_set_info.sg_camera[1].nCameraID == 0)
	{
		g_set_info.nCameraAlarm &= (~alarmEnable)|0x01;
		SCI_TRACE_LOW( "<<SG_Rcv_Camera_Stop_Ask: Condition clear alarm.\r\n");
	}

	g_set_info.sg_camera[0].setCount = 1;
	g_set_info.sg_camera[0].nCount = 0;

	SG_Set_Save();

	para[0] = 0;

	// 删除队列中所有的任务
	while(CurrCamera.head != NULL)
	{
		camera_cmd_delete();
	}

	// 10s钟之后自动休眠，这里不做处理

	return 1;
}

/****************************************************************
  函数名：SG_Return_Config
  功  能  ：返回初始参数设置的应答短信
  输入参数：无
  输出参数：无
  编写者  ：林兆剑
  修改记录：创建，2008-10-29

****************************************************************/
void SG_Return_Config(void)
{
	xSignalHeaderRec      *signal_ptr = NULL;
	char title[200]= "";
	int pTP_len;
	unsigned char pTP_UD[200]="";

	SCI_TRACE_LOW( "==============SG_Return_Config========");


	strcat(title, "本机号:\r");
	strcat(title, g_set_info.sOwnNo);
	strcat(title, "\r");

	strcat(title, "通讯方式: ");
	if (g_set_info.nNetType == MSG_NET_SMS)
		strcat(title, "短信");
	else if (g_set_info.nNetType == MSG_NET_GPRS)
		strcat(title, "数据");
	else if (g_set_info.nNetType == MSG_NET_UNION)
		strcat(title, "混合");
	strcat(title, "\r");

	strcat(title, "IP:");
	strcat(title, "\r");
	strcat(title, g_set_info.sCenterIp);
	strcat(title, "  ");
	sprintf(title+strlen(title), "%d", g_set_info.nCenterPort);
	strcat(title, "\r");
	if(g_set_info.bProxyEnable==1)
		strcat(title, "使用代理\r");
	else
		strcat(title, "不使用代理\r");

	pTP_len= GBK2Unicode(pTP_UD, (unsigned char*)title);
	UnicodeBE2LE(pTP_UD, pTP_len);
	SendMsgReqToMN((uint8*)g_state_info.sUserNo,(uint8*)pTP_UD,pTP_len,MN_SMS_UCS2_ALPHABET);

}

/****************************************************************
  函数名：SG_Set_UserNo
  功  能  ：设置绑定
  输入参数：para:
  输出参数：无
  编写者  ：林兆剑
  修改记录：创建，2008-10-29

****************************************************************/
void SG_Set_UserNo(char* data)
{
	char *temp_ptr = NULL;
	char *temp_ptr0 = NULL;


	SCI_TRACE_LOW( "==============SG_Set_UserNo========");
	SG_Set_Cal_CheckSum();

	temp_ptr = strchr(data, '*');
	if(temp_ptr == NULL)
	{
		SCI_TRACE_LOW( "=======data == NULL=====");
		goto err;
	}

	//验证码
	temp_ptr += 1;
	temp_ptr0 = temp_ptr;
	temp_ptr = strchr(temp_ptr, '*');
	if(temp_ptr == NULL)
	{
		SCI_TRACE_LOW( "=======sUserPsw1=====");
		goto err;
	}

	if (temp_ptr-temp_ptr0 < 12)
	{
		char s1[12] ="" ;
		strncpy(s1, temp_ptr0, temp_ptr-temp_ptr0);
		if((strcmp((const char*)s1, (const char*)g_set_info.sUserPsw) != 0)
		 &&(strcmp((const char*)s1, (const char*)g_set_info.sChangePsw) != 0))
		{
			goto err;
		}
	}
	else
	{
		SCI_TRACE_LOW( "=======sUserPsw2=====");
		goto err;
	}

	//车主手机号
	temp_ptr += 1;
	temp_ptr0 = temp_ptr;
	temp_ptr = strchr(temp_ptr, '*');
	if(temp_ptr == NULL)
	{
		SCI_TRACE_LOW( "=======sUserNo1=====");
		goto err;
	}
	if (temp_ptr-temp_ptr0 <= SG_PHONE_LEN)
	{
		memset(g_set_info.sUserNo,0,sizeof(g_set_info.sUserNo));
		strncpy(g_set_info.sUserNo, temp_ptr0, temp_ptr-temp_ptr0);
	}
	else
	{
		SCI_TRACE_LOW( "=======sUserNo2=====");
		goto err;
	}

	//指令绑定
	temp_ptr += 1;
	temp_ptr0 = temp_ptr;
	temp_ptr = strchr(temp_ptr, '*');
	if(temp_ptr == NULL)
	{
		SCI_TRACE_LOW( "=======nNetType1=====");
		goto err;
	}
	g_set_info.SetEnable = temp_ptr0[0]-'0';

	if((g_set_info.SetEnable != 1)&&(g_set_info.SetEnable != 0))
	{
		SCI_TRACE_LOW( "=======nNetType2=====");
		goto err;
	}

	//报警绑定
	temp_ptr += 1;
	temp_ptr0 = temp_ptr;
	temp_ptr = strchr(temp_ptr, '*');
	if(temp_ptr == NULL)
	{
		SCI_TRACE_LOW( "=======nNetType1=====");
		goto err;
	}
	g_set_info.SmsEnable = temp_ptr0[0]-'0';

	if((g_set_info.SmsEnable != 1)&&(g_set_info.SmsEnable != 0))
	{
		SCI_TRACE_LOW( "=======nNetType2=====");
		goto err;
	}

	SG_Set_Save();
	SG_Return_UserNo();

	return;

err:
	SG_Return_Wrong();

}

