/****************************************************************
  函数名：SG_Return_NET
  功  能  ：返回网络状态
  输入参数：无
  输出参数：无
  编写者  ：林兆剑
  修改记录：创建，2008-10-29

****************************************************************/
int SG_Return_Net(void)
{
	char title[200]= "";
	int pTP_len;
	unsigned char pTP_UD[200]="";
	char net_status = 0;

	strcpy(title, "GPRS拨号阶段:\r\n");

	switch(g_gprs_t.state)
	{
		case GPRS_ACTIVE_PDP:
			strcat(title,"Active PDP上下文\n");
			break;
		case GPRS_DEACTIVE_PDP:
			strcat(title,"DeActive PDP上下文\n");
			break;
		case GPRS_SOCKET_CONNECT:
			strcat(title,"连接SOCKET\n");
			break;
		case GPRS_PORXY:
			strcat(title,"连接代理\n");
			break;
		case GPRS_HANDUP:
			strcat(title,"握手\n");
			break;
		case GPRS_RXHEAD:
		case GPRS_RXCONTENT:
			strcat(title,"链接中心正常\n");
			break;
		case GPRS_DISCONNECT:
			strcat(title,"连接断开\n");
			break;
		default:
			break;

	}

	// 上次发生的错误
	strcat(title,"\r最近错误:\r\n");

	switch(g_state_info.lasterr)
	{
		case SG_ERR_NONE:
			strcat(title,"未发生错误");
			break;
		case SG_ERR_CREAT_SOCKET:
			strcat(title,"建立Socket");
			break;
		case SG_ERR_PROXY_CONNET:
			strcat(title,"连接Proxy");
			break;
		case SG_ERR_PROXY_NOTFOUND:
			strcat(title,"连接中心");
			break;
		case SG_ERR_PROXY_DENY:
			strcat(title,"Proxy 拒绝");
			break;
		case SG_ERR_CONNET_CENTER:
			strcat(title,"中心错误");
			break;
		case SG_ERR_RCV_HANDUP:
			strcat(title, "握手应答");
			break;
		case SG_ERR_RCV_DATA:
			strcat(title,"接收数据");
			break;
		case SG_ERR_SEND_DATA:
			strcat(title, "发送数据");
			break;
		case SG_ERR_RCV_ANS:
			strcat(title, "接收应答");
			break;
		case SG_ERR_TIME_OUT:
			strcat(title, "超时错误，\n");
			switch(g_state_info.nNetTimeOut)
			{
				case GPRS_ACTIVE_PDP:
					strcat(title,"Active PDP上下文");
					break;
				case GPRS_DEACTIVE_PDP:
					strcat(title,"DeActive PDP上下文");
					break;
				case GPRS_PORXY:
					strcat(title,"连接代理");
					break;
				case GPRS_HANDUP:
					strcat(title,"握手");
					break;
				case GPRS_RXHEAD:
				case GPRS_RXCONTENT:
					strcat(title,"接收报文内容");
					break;
				case GPRS_SOCKET_CONNECT:
					strcat(title,"连接SOCKET");
					break;
			}
			strcat(title, "超时!");
			break;

		case SG_ERR_CLOSE_SOCKET:
			strcat(title, "关闭SOCKET");
			break;

		case SG_ERR_HOST_PARSE:
			strcat(title, "主机地址解析");
			break;
		case SG_ERR_ACTIVE_PDP:
			strcat(title, "激活PDP上下文");
			break;
		case SG_ERR_DEACTIVE_PDP:
			strcat(title, "去活PDP上下文");
			break;
		case SG_ERR_SET_OPT:
			strcat(title, "参数设置");
			break;
		default:
			break;
	}

	strcat(title, "\r\n");

	// 当前累计重连次数
	//sprintf(title+strlen(title), "累计重连次数:%ld次\r\n",ReConCnt);

	//sprintf(title+strlen(title), "运营商 %d\r\n",g_state_info.opter);
	net_status = SG_Net_Judge();

	switch(net_status)
	{
		case NO_SIM_CARD:
			strcat(title,"无SIM卡\r\n");
			break;
		case NO_NET_WORK:
			strcat(title,"无网络\r\n");
			break;
		case GSM_ONLY:
			strcat(title,"ONLY GSM\r\n");
			break;
		case GPRS_ONLY:
			strcat(title,"ONLY GPRS\r\n");
			break;
		case NETWORK_OK:
			strcat(title,"网络正常\r\n");
			break;
		default:
			break;
	}


	pTP_len= GBK2Unicode(pTP_UD, (unsigned char*)title);
	UnicodeBE2LE(pTP_UD, pTP_len);
	SendMsgReqToMN((uint8*)g_state_info.sUserNo,(uint8*)pTP_UD,pTP_len,MN_SMS_UCS2_ALPHABET);

	return 1;

}

